struct Data
{
	int hour;
	int minute;
	int mm;
};

void solve()
{
	int n;
	while(cin >> n, n)
	{
		int lunch_count = 0;
		int dinner_count = 0;
		int midnight_count = 0;
		int lunch_ok = 0;
		int dinner_ok = 0;
		int midnight_ok = 0;
		vector<Data> Vec(n);
		for(int i = 0; i < n; ++i)
		{
			scanf("%d%*c%d%d",&Vec[i].hour, &Vec[i].minute, &Vec[i].mm);
			if(11 <= Vec[i].hour && Vec[i].hour <= 14)
			{
				lunch_count++;
				for(int j = -8; j <= 8; ++j)
				{
					int time = Vec[i].minute;
					if(time + j < 0)
					{
						time += 60;
					}
					if((time + j) % 60 == Vec[i].mm)
					{
						lunch_ok++;
					}
				}
			}
			else if(18 <= Vec[i].hour && Vec[i].hour <= 20)
			{
				dinner_count++;
				for(int j = -8; j <= 8; ++j)
				{
					int time = Vec[i].minute;
					if(time + j < 0)
					{
						time += 60;
					}
					if((time + j) % 60 == Vec[i].mm)
					{
						dinner_ok++;
					}
				}
			}
			else if(21 <= Vec[i].hour && Vec[i].hour <= 23 || Vec[i].hour == 0 || Vec[i].hour == 1)
			{
				midnight_count++;
				for(int j = -8; j <= 8; ++j)
				{
					int time = Vec[i].minute;
					if(time + j < 0)
					{
						time += 60;
					}
					if((time + j) % 60 == Vec[i].mm)
					{
						midnight_ok++;
					}
				}
			}
		}
		if(lunch_count)
		{
			cout << "lunch " << lunch_ok * 100 / lunch_count << endl;
		}
		else
		{
			cout << "lunch no guest" << endl;
		}
		if(dinner_count)
		{
			cout << "dinner " << dinner_ok * 100 / dinner_count << endl;
		}
		else
		{
			cout << "dinner no guest" << endl;
		}
		if(midnight_count)
		{
			cout << "midnight " << midnight_ok * 100 / midnight_count << endl;
		}
		else
		{
			cout << "midnight no guest" << endl;
		}	
	}
}

