	if(h*60+m>=11*60 && h*60+m<15*60)return true;
	else return false;
}

bool evening(int h,int m){
	if(h*60+m>=18*60 && h*60+m<21*60)return true;
	else return false;
}

bool night(int h,int m){
	if((h*60+m>=21*60 && h*60+m<24*60)||(h*60+m<2*60))return true;
	else return false;
}

bool last(int h,int m,int s){
	if(h*60+m+s>=2*60)return false;
	else return true;
}

