			{
				lunch_count++;
				for(int j = -8; j <= 8; ++j)
				{
					int time = Vec[i].minute;
					if(time + j < 0)
					{
						time += 60;
					}
					if((time + j) % 60 == Vec[i].mm)
					{
						lunch_ok++;
					}
				}
			}
			else if(18 <= Vec[i].hour && Vec[i].hour <= 20)
			{
				dinner_count++;
				for(int j = -8; j <= 8; ++j)
				{
					int time = Vec[i].minute;
					if(time + j < 0)
					{
						time += 60;
					}
					if((time + j) % 60 == Vec[i].mm)
					{
						dinner_ok++;
					}
				}
			}
			else if(21 <= Vec[i].hour && Vec[i].hour <= 23 || Vec[i].hour == 0 || Vec[i].hour == 1)
			{
				midnight_count++;
				for(int j = -8; j <= 8; ++j)
