int f(int a,int b,int c) {
    int s1=a*60+b;
    if(11*60<=s1&&s1<=14*60+59) return 0;
    if(18*60<=s1&&s1<=20*60+59) return 1;
    if(21*60<=s1&&s1<=25*60+59) return 2;
