	dinner,
	midnight,
	other,
};

struct Info{
	Type type;
	bool isOK;
};

Info func(char print_time[6],char serve_time[3]){

	Info ret;

	int print_hour = 10*(print_time[0]-'0')+print_time[1]-'0';
	int print_minute = 10*(print_time[3]-'0')+print_time[4]-'0';

	int serve_minute = 10*(serve_time[0]-'0')+serve_time[1]-'0';

	if(print_hour >= 11 && print_hour <= 14){
		ret.type = lunch;
	}else if(print_hour >= 18 && print_hour <= 20){
		ret.type = dinner;
	}else if((print_hour >= 21 && print_hour <= 23) || (print_hour >= 0 && print_hour <= 1)){
		ret.type = midnight;
	}else{
		ret.type = other;
		ret.isOK = false;
		return ret;
	}

	if(print_minute > serve_minute){
		serve_minute += 60;
	}

	if(serve_minute-print_minute <= 8){
		ret.isOK = true;
	}else{
		ret.isOK = false;
	}

	return ret;
}


int main(){

	int ok[3] = {0,0,0},total[4] = {0,0,0,0},N;

