	if(total[dinner] == 0){
		printf("no guest\n");
	}else{
		printf("dinner %d\n",100*ok[dinner]/total[dinner]);
	}

	if(total[midnight] == 0){
		printf("no guest\n");
	}else{
		printf("midnight %d\n",100*ok[midnight]/total[midnight]);
	}

   return 0;
}

