void change(string s){
  int i,x=1;
  h=0;
  m=0;
  for(i=0;i<5;i++){
    if(0<=i&&i<=1){
      h=x*h+(s[i]-'0');
      x*=10;
      if(i==1) x=1;
    }
    else if(3<=i&&i<=4){
      m=x*m+(s[i]-'0');
      x*=10;
    }
  }
}
int timecal(int m,int MM){
  int ret;
  if(m<=MM) ret=MM-m;
  else{
    MM+=60;
    ret=MM-m;
  }
  return ret;
}

