		//18:00~20:59,
		//21:00~01:59

		int[] total=new int[3];//0-initialized
		int[] cnt=new int[3];//0-initialized

		for(int i=0;i<N;i++){
			var d=Array.ConvertAll(Console.ReadLine().Split(new char[]{' ',':'}),e=>int.Parse(e));
			int m=d[2]-d[1];
			if(m<0)m+=60;
			if(d[0]*60+d[1]>=11*60+0 && d[0]*60+d[1]<=14*60+59){
				total[0]++;
				if(m<=8)cnt[0]++;
			}
			if(d[0]*60+d[1]>=18*60+0 && d[0]*60+d[1]<=20*60+59){
				total[1]++;
				if(m<=8)cnt[1]++;
			}
