				total[2]++;
				if(m<=8)cnt[2]++;
			}
			if(d[0]*60+d[1]>=0*60+0 && d[0]*60+d[1]<=1*60+59){
				total[2]++;
				if(m<=8)cnt[2]++;
			}
		}
		Console.WriteLine("lunch "   +(total[0]==0?"no guest":(100*cnt[0]/total[0]).ToString()));
		Console.WriteLine("dinner "  +(total[1]==0?"no guest":(100*cnt[1]/total[1]).ToString()));
		Console.WriteLine("midnight "+(total[2]==0?"no guest":(100*cnt[2]/total[2]).ToString()));

	}

